import React from 'react';
import Navbar from './Navbar';
import $ from 'jquery';

function Home() {
    const handleToggle = () => {
        $('#sidebar').toggleClass('active');
    };
    return (
        <div class='wrapper'>
            <Navbar />
            <div id='content'>
                <div class='container-fluid ustify-content-center'>
                    <button
                        type='button'
                        id='sidebarCollapse'
                        class='btn '
                        style={{
                            background: 'transparent',
                            position: 'absolute',
                            top: '10px',
                            right: 0,
                            zIndex: 1000,
                        }}
                        onClick={handleToggle}>
                        <i class='fas fa-align-'></i>
                    </button>
                    <h1
                        className='text-center'
                        style={{ fontWeight: '600', fontSize: '4em' }}>
                        ahum
                    </h1>
                </div>
            </div>
        </div>
    );
}

export default Home;
